result:
query($page: Int){
  entries: allProject (perPage: 10, page: $page, sortBy: "rank", order: DESC, filter: { tags: { id: {in: ["farming", "cloud", "grid", "digitaltwin"]}}})@paginate{
    totalCount
    pageInfo {
      totalPages
      currentPage
    }
    edges {
      node {
        id
        title
        path
        tags{
          id
          title
          path
        }
        members {
          id
          name
          image(width:64, height:64, fit:inside)
          path
        },
        rank
        linkedin
        excerpt
        image(width:800)
        timeToRead
        logo
      }
    }
  }
  
  tags: allProjectTag{
     edges{
      node{
        id
        title
        path
      }
  }
}

}
